import './file-upload.css'

function Demo() {
  return (
    <div className="file-upload">
      <label htmlFor="file-input">
        <i className="fas fa-cloud-upload-alt"></i> Choose file
      </label>
      <input id="file-input" type="file" name="file"/>
      {/* <button type="submit">Upload</button> */}
    </div>
  );
}

export default Demo;
